import React, { useState, useEffect } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

const Home = () => {
    const [personas, setPersonas] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);

    useEffect(() => {
        fetchPersonas();
    }, []);

    const fetchPersonas = async () => {
        try {
            const response = await fetch('http://localhost:9001/Laboratorio1/personas');
            if (!response.ok) {
                throw new Error(`HTTP error! status: ${response.status}`);
            }
            const data = await response.json();
            setPersonas(data);
            setLoading(false);
        } catch (e) {
            console.error("Hubo un problema con la petición Fetch:", e);
            setError('No se pudieron cargar los datos. Por favor, intente de nuevo más tarde.');
            setLoading(false);
        }
    };

    if (loading) return <div className="text-center mt-5">Cargando...</div>;
    if (error) return <div className="text-center mt-5 text-danger">{error}</div>;

    return (
        <div className="container mt-5">
            <h1 className="mb-4">Listado de Personas Registradas</h1>
            <div className="table-responsive">
                <table className="table table-striped table-hover">
                    <thead className="table-dark">
                        <tr>
                            <th>ID</th>
                            <th>Nombre Completo</th>
                            <th>Identificación</th>
                            <th>Email</th>
                            <th>Fecha de Nacimiento</th>
                            <th>Edad</th>
                            <th>Usuario</th>
                        </tr>
                    </thead>
                    <tbody>
                        {personas.map((persona) => (
                            <tr key={persona.id}>
                                <td>{persona.id}</td>
                                <td>{`${persona.pnombre} ${persona.SNombre || ''} ${persona.PApellido} ${persona.SApellido || ''}`}</td>
                                <td>{persona.identificacion}</td>
                                <td>{persona.email}</td>
                                <td>{persona.fechaNacimiento}</td>
                                <td>{persona.edad}</td>
                                <td>{persona.usuario ? persona.usuario.login : 'N/A'}</td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>
        </div>
    );
};

export default Home;
